  throttleInput = (event) => {
    let thisInput = Date.now();
    if ((thisInput - 1000) > this.lastInput) {
      this.lastInput = thisInput;
      this.dispatchInput(event);
    }
  };

  dispatchInput = (event) => {
    let index = event.target.value;
    let time = this.times[index];
    this.props.changeLayerTime(time);
    console.log('changed time:', time);
  };

  render () {
    return (
      <div>
        <input
          onInput={this.throttleInput}
          type="range"
          min={0}
          max={(this.times.length - 1)}
        />
      </div>
    );
  }
